CREATE TABLE orders(
   order_id        VARCHAR(50) NOT NULL PRIMARY KEY,
   product_name    VARCHAR(200) NOT NULL,
   category        VARCHAR(40) NOT NULL,
   selling_price   NUMERIC(8,2) NOT NULL,
   shipping_method VARCHAR(10) NOT NULL,
   shipping_price  NUMERIC(4,1) NOT NULL
);



select * from orders

SELECT product_name, selling_price, SUM(selling_price)
OVER (ORDER BY order_id)
FROM orders
WHERE category = 'Baby Products';

SELECT product_name, selling_price,
	RANK() OVER (ORDER BY selling_price DESC)
FROM orders;

SELECT product_name, selling_price, category,
	RANK() OVER (PARTITION BY category ORDER BY selling_price DESC)
FROM orders;


